import React from 'react';
import Header from '../components/Header';
import Food from '../components/Food';
import SearchHome from '../components/Search';
import BottomHome from '../components/Bottom';


function FoodHTML() {
  return (
    <>
      <Header />
      <Food />
      <SearchHome />
      <BottomHome />
    </>
  );
}

export default FoodHTML;
